import React, { Component } from 'react'
const GroupName = ["A", "B", "C", "D", "E", "F", "G", "H"]
const GroupColor = ["#FFCA28", "#FF7043", "#001529", "#2E7D32", "#607D8B", "#00B8D4", "#BDBDBD", "#D500F9"]
export default class GroupCard extends Component {
  renderList = () => {
    return this.props.data.map(elem => (
      <li className="list-item"><img className="clubllogo" src={elem.logo} />&nbsp;&nbsp;{elem.name}</li>
    ))
  }

  render() {

    return (
      <div>
        <div class="card groupCard">
          <header class="card-header">
            <p class="card-header-title">
              Group {GroupName[this.props.index]}
            </p>
          </header>
          <div class="card-content">
            <ul>
              {this.renderList()}
            </ul>
          </div>

        </div>
      </div>
    )
  }
}
